	"resource": "OperationOutcome",
	"issue": [
		{
			"severity": "error",
			"code": "exception",
			"diagnostics": "Problemas en el Servidor"
		}			]
}

var tmp = JSON.stringify(jsonResponse);

// Enviar la respuesta
responseMap.put('tmp', tmp);
responseMap.put('Status', "500");

// Log de la respuesta para depuracin
//logger.info("Respuesta enviada: " + tmp);

return(tmp)

